val accidentRDD = sc.textFile("/resources/data/accident.csv").map(line => line.split(",", -1).map(_.trim)).filter(line => line(0) != "STATE")

case class Accident(
    state: Int,
    stCase: Int,
    day: Int,
    month: Int,
    year: Int,
    hour: Int,
    minute: Int,
    lightCondition: Int,
    weather: Int,
    fatals: Int,
    drunkDrivers: Int
  )

// patching the String class with new functions that have a defualt value if conversion to another type fails.
implicit class StringConversion(val s: String) {
def toTypeOrElse[T](convert: String=>T, defaultVal: T) = try {
    convert(s)
  } catch {
    case _: Throwable => defaultVal
  }

  def toIntOrElse(defaultVal: Int = 0) = toTypeOrElse[Int](_.toInt, defaultVal)
  def toDoubleOrElse(defaultVal: Double = 0D) = toTypeOrElse[Double](_.toDouble, defaultVal)
}

// clean up Accident fields and convert them to proper formats
def getAccident(row:Array[String]):Accident = {
  return Accident(
    row(0).toInt,
    row(1).toInt,
    row(11).toInt,
    row(12).toInt,
    row(13).toInt,
    row(15).toInt,
    row(16).toInt,
    row(35).toInt,
    row(38).toInt,
    row(50).toInt,
    row(51).toInt
  )
}

// load the data into a DataFrame used for SparkSQL
val accident = accidentRDD.map(r => getAccident(r)).toDF()
// register this data as an SQL table
accident.createOrReplaceTempView("accident")

